style.css:
@-moz-document domain("office.gameinn.co") {

html::after {
    background-image: none;
}

#ed .t-bg--primary {
    background-color: #323232!important;
    border: 1px solid #FFFFFF;
}

.si-theme--dark {
    --si-warning-100: #494949;
}

.uk-link-toggle:hover .uk-link, .uk-link:hover, a:hover {
    color: #d2b48cbd;
    /*color: tan;*/
}

#ed .is-editor-markup {
    font-size: 16px;
}

.uk-navbar-dropdown {
    background-color: #555753;
}

div.uk-navbar-container>div.uk-container{
    padding: 0 3rem;
}

.uk-navbar-nav>li>a {
    font-style: normal;
}

.uk-navbar-nav>li:hover>a, .uk-navbar-nav>li>a[aria-expanded=true] {
    animation: none;
    color: tan;
}

h2.o-title {
    color: tan;
}

#ed .o-empty {
    background-color: unset;
}

.uk-section-default {
    background-image: none;
    /*background-color: #2e3436;*/
}

.uk-link, a {
    /*color: slategray;*/
    color: tan;
    transition: 0.2s;
}

#fd .fd-toolbar__link {
    transition: 0.2s;
}

#ed, .atwho-container, .com_easydiscuss, .select2-container--si {
    --si-font-family: Roboto,arial,montserrat,system-ui,-apple-system,"Segoe UI",Roboto,"Helvetica Neue",Arial,"Noto Sans",sans-serif,"Apple Color Emoji","Segoe UI Emoji","Segoe UI Symbol","Noto Color Emoji";
    --si-root-font-size: 16px;
    --si-font-size--01: calc(var(--si-root-font-size)*0.75);
    --si-font-size--02: calc(var(--si-root-font-size)*0.92);
    --si-font-size--03: calc(var(--si-root-font-size)*1);
    --si-font-size--04: calc(var(--si-root-font-size)*1.125);
    --si-font-size--05: calc(var(--si-root-font-size)*1.25);
    --si-font-size--06: calc(var(--si-root-font-size)*1.5);
    --si-font-size--07: calc(var(--si-root-font-size)*1.75);
    --si-font-size--08: calc(var(--si-root-font-size)*2);
    --si-font-size--09: calc(var(--si-root-font-size)*2.25);
    --si-font-size--10: calc(var(--si-root-font-size)*2.625);
    --si-line-height--sm: calc(var(--si-root-font-size)*1.25);
    --si-line-height: calc(var(--si-root-font-size)*1.5);
    --si-ui-radius: calc(var(--si-root-font-size)*0.25);
    --si-ui-radius--sm: calc(var(--si-root-font-size)*0.125);
    --si-ui-radius--lg: calc(var(--si-root-font-size)*0.5);
    --si-spacing--no: 0;
    --si-spacing: var(--si-root-font-size);
}

.uk-navbar-container:not(.uk-navbar-transparent) {
    /* background: rgba(40,33,85,.95); */
    /* background-image: linear-gradient(180deg,#1d1e4c 10%,rgba(131,51,193,.15) 100%); */
    /* background-color: #272C2D; */
}

.uk-navbar-container:not(.uk-navbar-transparent) {
    background-image: linear-gradient(180deg,#272C2D 10%,rgba(131,51,193,.15) 100%);
}

.uk-container {
    padding-left: 2.5rem;
    padding-right: 2.5rem;
}

/* .uk-container {
    max-width: unset;
} */


::selection {
    background: #2e3436;
}

#ed .ed-reply-form {
    border-radius: calc(var(--si-ui-radius)*2);
}

/* #fd, .si-theme-foundry, .tippy-box, .tippy-box[data-theme~=fd-dark], .tribute-container {
    --fd-border-radius-md: 3em;
} */

#fd .fd-toolbar__o-nav {
    border-radius: 3em !important;
}

    nav.o-nav.fd-toolbar__o-nav a {
    border-radius: 3em !important;
}

.uk-navbar-container:not(.uk-navbar-transparent) {
    background: unset;
    background-image: unset;
    /* background-color: #323232; */
    background-color: unset;
}

#fd .fd-toolbar .is-active .fd-toolbar__link:not(.no-active-state), #fd .fd-toolbar .is-active .fd-toolbar__submenu-link {
    color: antiquewhite;
}

#fd .fd-toolbar .is-active .fd-toolbar__link:not(.no-active-state), #fd .fd-toolbar .is-active .fd-toolbar__submenu-link {
    background-color: #292929
}

.uk-navbar-nav>li>a {
    text-transform: none;
}

html {
    background-color: #2e3436;
    font-family: arial;
    font-size: 16px;
}

.uk-section-secondary {
    background: unset;
}

#ed .ed-comment-item {
    font-size: unset;
    line-height: unset;
}

a.o-avatar, #ed .ed-comment-item .o-avatar--rounded img {
    width: 4rem !important;
    height: 4rem !important;
}

#ed .ed-comment-item, #ed .ed-comments {
    background-color: #232c30;
}

body {
    /*background-image: url(https://wallpapercave.com/wp/wp9596524.jpg);*/
    background-color: #2e3436;
    background-size: contain;
    background-attachment: fixed;
    background-blend-mode: soft-light;
    /*background-image: url(https://images.hdqwalls.com/download/purple-night-ride-4k-qz-2560x1700.jpg);*/
    background-image: url(https://img3.goodfon.ru/original/1920x1080/a/e1/kote-koshak-kotik-koshka.jpg);
    background-image: url(https://getwallpapers.com/wallpaper/full/d/b/c/152517.jpg);
background-image: url(https://images.wallpaperscraft.ru/image/single/olen_art_vektor_134088_3840x2400.jpg);
    background-image: unset;
    background-size: cover;
    background-position: center;
} 

.tm-page {
    border-image: unset;
    border-top-width: 0;
}

#fd .fd-toolbar__link:hover {
    --tw-bg-opacity: 0.65;
    background-color: var(--fd-gray-100-hex,rgba(var(--fd-gray-100),var(--tw-bg-opacity)));
}
}
